import React from 'react';
import './sidenav.css';

export default function SideNav() {
    return (
        <div class='side-nav-bar'>
            <button id='composeMailBtn' onClick={() => alert('Ajay')}>Compose</button>
            <ul>
                <li className="active">
                    Inbox
                    (<span className='unreadMail'>1</span>)
                </li>
                <li>Sent(<span className='unreadMail'>1</span>)</li>
                <li>Trash</li>
            </ul>
        </div>
    );
}
